import React from 'react';

function VideoPreviewComponent({ processedFramePath }) {
  const getVideoPreview = () => {
    if (processedFramePath) {
      return (
        <img src={processedFramePath} alt="Processed frame" />
      );

    } else {
      return <p>No video preview available.</p>;
    }
  };

  return (
    <div className="video-preview-component">
      <h2>Preview</h2>
    </div>
  );
}

export default VideoPreviewComponent;
